**注意事项:**
- 适用于自动化测试和本地开发环境，无需手动管理 Ollama 服务。
- 支持自定义模型镜像和本地缓存，提升测试效率。
- 依赖 `utils.OllamaImage`、`LangChain4jOllamaContainer` 等工具类。

```java
package utils;

import static dev.langchain4j.internal.Utils.isNullOrEmpty;
import static utils.OllamaImage.LLAMA_3_1;
import static utils.OllamaImage.localOllamaImage;

public class AbstractOllamaInfrastructure {

public static final String OLLAMA_BASE_URL = System.getenv("OLLAMA_BASE_URL");
    public static final String MODEL_NAME = LLAMA_3_1;

public static LangChain4jOllamaContainer ollama;

static {
        if (isNullOrEmpty(OLLAMA_BASE_URL)) {
            String localOllamaImage = localOllamaImage(MODEL_NAME);
            ollama = new LangChain4jOllamaContainer(OllamaImage.resolve(OllamaImage.OLLAMA_IMAGE, localOllamaImage))
                    .withModel(MODEL_NAME);
            ollama.start();
            ollama.commitToImage(localOllamaImage);
        }
    }

public static String ollamaBaseUrl(LangChain4jOllamaContainer ollama) {
        if (isNullOrEmpty(OLLAMA_BASE_URL)) {
            return ollama.getEndpoint();
        } else {
            return OLLAMA_BASE_URL;
        }
    }
}

最简单的 AI 服务[​](#最简单的-ai-服务 "最简单的 AI 服务的直接链接")
--------------------------------------------

首先，我们定义一个带有单个方法 `chat` 的接口，该方法接受 `String` 作为输入并返回 `String`。

interface Assistant {    String chat(String userMessage);}

然后，我们创建低级组件。这些组件将在我们的 AI 服务底层使用。 在这种情况下，我们只需要 `ChatLanguageModel`：

ChatLanguageModel model = OpenAiChatModel.builder()    .apiKey(System.getenv("OPENAI_API_KEY"))    .modelName(GPT_4_O_MINI)    .build();

最后，我们可以使用 `AiServices` 类创建我们的 AI 服务实例：

Assistant assistant = AiServices.create(Assistant.class, model);

备注

Friend friend = AiServices.builder(Friend.class)    .chatLanguageModel(model)    .systemMessageProvider(chatMemoryId -> "You are a good friend of mine. Answer using slang.")    .build();

如您所见，您可以根据聊天记忆 ID（用户或对话）提供不同的系统消息。

@UserMessage[​](#usermessage "@UserMessage的直接链接")
-------------------------------------------------

现在，假设我们使用的模型不支持系统消息， 或者我们只想为此目的使用 `UserMessage`。

interface Friend {    @UserMessage("You are a good friend of mine. Answer using slang. {{it}}")    String chat(String userMessage);}Friend friend = AiServices.create(Friend.class, model);String answer = friend.chat("Hello"); // Hey! What's shakin'?

以下是如何启用 JSON 模式：

*   对于 OpenAI：

*   对于支持[结构化输出](https://openai.com/index/introducing-structured-outputs-in-the-api/)的较新模型（例如，`gpt-4o-mini`、`gpt-4o-2024-08-06`）：

OpenAiChatModel.builder()    ...    .supportedCapabilities(RESPONSE_FORMAT_JSON_SCHEMA)    .strictJsonSchema(true)    .build();

查看[此处](/integrations/language-models/open-ai#structured-outputs)了解更多详情。
    *   对于较旧的模型（例如 gpt-3.5-turbo、gpt-4）：

OpenAiChatModel.builder()    ...    .responseFormat("json_object")    .build();

*   对于 Azure OpenAI：

AzureOpenAiChatModel.builder()    ...    .responseFormat(new ChatCompletionsJsonResponseFormat())    .build();

*   对于 Vertex AI Gemini：

VertexAiGeminiChatModel.builder()    ...    .responseMimeType("application/json")    .build();

或通过从 Java 类指定显式模式：

VertexAiGeminiChatModel.builder()    ...    .responseSchema(SchemaHelper.fromClass(Person.class))    .build();

从 JSON 模式：

VertexAiGeminiChatModel.builder()    ...    .responseSchema(Schema.builder()...build())    .build();

*   对于 Google AI Gemini：

GoogleAiGeminiChatModel.builder()    ...    .responseFormat(ResponseFormat.JSON)    .build();

或通过从 Java 类指定显式模式：

GoogleAiGeminiChatModel.builder()    ...    .responseFormat(ResponseFormat.builder()        .type(JSON)        .jsonSchema(JsonSchemas.jsonSchemaFrom(Person.class).get())        .build())    .build();

从 JSON 模式：

GoogleAiGeminiChatModel.builder()    ...    .responseFormat(ResponseFormat.builder()        .type(JSON)        .jsonSchema(JsonSchema.builder()...build())        .build())    .build();

*   对于 Mistral AI：

MistralAiChatModel.builder()    ...    .responseFormat(MistralAiResponseFormatType.JSON_OBJECT)
    .build();

*   对于 Ollama：

OllamaChatModel.builder()    ...    .responseFormat(JSON)    .build();

*   对于其他模型提供商：如果底层模型提供商不支持 JSON 模式， 提示工程是您最好的选择。此外，尝试降低 `temperature` 以获得更确定性的结果。

[更多示例](https://github.com/langchain4j/langchain4j-examples/blob/main/other-examples/src/main/java/OtherServiceExamples.java)

AnthropicStreamingChatModel model = AnthropicStreamingChatModel.builder()    .apiKey(System.getenv("ANTHROPIC_API_KEY"))    .modelName(CLAUDE_3_5_SONNET_20240620)    .build();model.chat("Say 'Hello World'", new StreamingChatResponseHandler() {    @Override    public void onPartialResponse(String partialResponse) {        // 当有新的部分响应可用时调用此方法。它可以由一个或多个令牌组成。    }    @Override    public void onCompleteResponse(ChatResponse completeResponse) {        // 当模型完成响应时调用此方法    }    @Override    public void onError(Throwable error) {        // 当发生错误时调用此方法    }});

### 自定义 AnthropicStreamingChatModel[​](#自定义-anthropicstreamingchatmodel "自定义 AnthropicStreamingChatModel的直接链接")

与 `AnthropicChatModel` 相同，请参见上文。

```java
import dev.langchain4j.data.message.ImageContent;
import dev.langchain4j.data.message.SystemMessage;
import dev.langchain4j.data.message.TextContent;
import dev.langchain4j.data.message.UserMessage;
import dev.langchain4j.model.anthropic.AnthropicChatModel;
import dev.langchain4j.model.anthropic.AnthropicChatModelName;
import dev.langchain4j.model.anthropic.AnthropicTokenUsage;
import dev.langchain4j.model.chat.ChatModel;
import dev.langchain4j.model.chat.response.ChatResponse;
import org.junit.jupiter.api.Test;

import java.util.Base64;

import static dev.langchain4j.internal.Utils.readBytes;
import static org.assertj.core.api.Assertions.assertThat;

class AnthropicChatModelTest {

ChatModel model = AnthropicChatModel.builder()
            // API key can be created here: https://console.anthropic.com/settings/keys
            .apiKey(System.getenv("ANTHROPIC_API_KEY"))
            .modelName("claude-3-haiku-20240307")
            .logRequests(true)
            .logResponses(true)
            // Other parameters can be set as well
            .build();

@Test
    void AnthropicChatModel_Example() {

String answer = model.chat("What is the capital of Germany?");

assertThat(answer).containsIgnoringCase("Berlin");
    }

@Test
    void AnthropicChatModel_with_vision_Example() {

byte[] image = readBytes("https://docs.langchain4j.dev/img/langchain4j-components.png");
        String base64EncodedImage = Base64.getEncoder().encodeToString(image);

String base64EncodedImage = Base64.getEncoder().encodeToString(image);

UserMessage userMessage = UserMessage.from(
                TextContent.from("What do you see?"),
                ImageContent.from(base64EncodedImage, "image/png")
        );

ChatResponse chatResponse = model.chat(userMessage);

assertThat(chatResponse.aiMessage().text()).containsIgnoringCase("RAG");
    }

@Test
    void AnthropicChatModel_with_cache_system_message_Example() {
        ChatModel modelWithCache = AnthropicChatModel.builder()
                .apiKey(System.getenv("ANTHROPIC_API_KEY"))
                .beta("prompt-caching-2024-07-31")
                .modelName(AnthropicChatModelName.CLAUDE_3_HAIKU_20240307)
                .cacheSystemMessages(true)
                .logRequests(true)
                .logResponses(true)
                .build();

// Now cache has in beta
        // You can send up to 4 systemMessages/Tools

// create cache
        SystemMessage systemMessage = SystemMessage.from("What types of messages are supported in LangChain?".repeat(187));
        UserMessage userMessage = UserMessage.userMessage("what result it calcule 5x2 + 2x + 2 = 0?");
        ChatResponse response = modelWithCache.chat(systemMessage, userMessage);

AnthropicTokenUsage createCacheTokenUsage = (AnthropicTokenUsage) response.metadata().tokenUsage();
        assertThat(createCacheTokenUsage.cacheCreationInputTokens()).isGreaterThan(0);

// read cache created
        ChatResponse responseToReadCache = modelWithCache.chat(systemMessage, userMessage);
        AnthropicTokenUsage readCacheTokenUsage = (AnthropicTokenUsage) responseToReadCache.metadata().tokenUsage();
        assertThat(readCacheTokenUsage.cacheReadInputTokens()).isGreaterThan(0);
    }
}

**注意事项:**
- 运行此示例需要有效的 `ANTHROPIC_API_KEY` 环境变量。
- `modelName` 可以根据需要选择不同的 Anthropic Claude 模型。
- `logRequests(true)` 可以启用请求的日志记录，便于调试。
- `CompletableFuture` 用于等待流式响应的完成，确保测试在收到完整响应后才结束。

```java
import dev.langchain4j.model.anthropic.AnthropicStreamingChatModel;
import dev.langchain4j.model.chat.StreamingChatModel;
import dev.langchain4j.model.chat.response.ChatResponse;
import dev.langchain4j.model.chat.response.StreamingChatResponseHandler;
import org.junit.jupiter.api.Test;

import java.util.concurrent.CompletableFuture;
import java.util.concurrent.ExecutionException;

import static org.assertj.core.api.Assertions.assertThat;

class AnthropicStreamingChatModelTest {

StreamingChatModel model = AnthropicStreamingChatModel.builder()
            // API key can be created here: https://console.anthropic.com/settings/keys
            .apiKey(System.getenv("ANTHROPIC_API_KEY"))
            .modelName("claude-3-haiku-20240307")
            .logRequests(true)
            // Other parameters can be set as well
            .build();

@Test
    void AnthropicChatModel_Example() throws ExecutionException, InterruptedException {

CompletableFuture<ChatResponse> future = new CompletableFuture<>();

model.chat("What is the capital of Germany?", new StreamingChatResponseHandler() {

@Override
            public void onPartialResponse(String partialResponse) {
                System.out.println("New token: '" + partialResponse + "'");
            }

@Override
            public void onCompleteResponse(ChatResponse completeResponse) {
                System.out.println("Streaming completed: " + completeResponse);
                future.complete(completeResponse);
            }

@Override
            public void onError(Throwable error) {
                future.completeExceptionally(error);
            }
        });

assertThat(future.get().aiMessage().text()).containsIgnoringCase("Berlin");
    }
}

**注意事项:**
- 运行此示例需要有效的 `ANTHROPIC_API_KEY` 环境变量。
- `modelName` 可以根据需要选择不同的 Anthropic Claude 模型。
- `logRequests(true)` 和 `logResponses(true)` 可以启用请求和响应的日志记录，便于调试。
- `AiServices` 会自动处理工具的注册和调用，简化了与 LLM 的交互。

```java
import dev.langchain4j.agent.tool.Tool;
import dev.langchain4j.model.anthropic.AnthropicChatModel;
import dev.langchain4j.model.chat.ChatModel;
import dev.langchain4j.service.AiServices;
import org.junit.jupiter.api.Test;

import java.time.LocalDate;
import java.time.LocalTime;

import static dev.langchain4j.model.anthropic.AnthropicChatModelName.CLAUDE_3_HAIKU_20240307;
import static org.assertj.core.api.Assertions.assertThat;

import static org.assertj.core.api.Assertions.assertThat;

class AnthropicToolsTest {

ChatModel model = AnthropicChatModel.builder()
            // API key can be created here: https://console.anthropic.com/settings/keys
            .apiKey(System.getenv("ANTHROPIC_API_KEY"))
            .modelName(CLAUDE_3_HAIKU_20240307)
            .logRequests(true)
            .logResponses(true)
            // Other parameters can be set as well
            .build();

static class Tools {

@Tool
        LocalDate currentDate() {
            System.out.println("Called currentDate()");
            return LocalDate.now();
        }

@Tool
        LocalTime currentTime() {
            System.out.println("Called currentTime()");
            return LocalTime.now();
        }
    }

interface AiService {

String chat(String userMessage);
    }

@Test
    void AnthropicChatModel_Tools_Example() {

AiService aiService = AiServices.builder(AiService.class)
                .chatModel(model)
                .tools(new Tools())
                .build();

.chatModel(model)
                .tools(new Tools())
                .build();

String answer = aiService.chat("What is the date today?");
        System.out.println(answer);

assertThat(answer).contains(String.valueOf(LocalDate.now().getDayOfMonth()));
    }
}

上述部分参数的描述可以在[这里](https://learn.microsoft.com/en-us/azure/ai-services/openai/reference#completions)找到。

此配置将创建一个 `AzureOpenAiChatModel` bean（具有默认模型参数）， 可以由 [AI 服务](/tutorials/spring-boot-integration/#langchain4j-spring-boot-starter)使用， 或在需要的地方自动装配，例如：

@RestControllerclass ChatLanguageModelController {    ChatLanguageModel chatLanguageModel;    ChatLanguageModelController(ChatLanguageModel chatLanguageModel) {        this.chatLanguageModel = chatLanguageModel;    }    @GetMapping("/model")    public String model(@RequestParam(value = "message", defaultValue = "Hello") String message) {        return chatLanguageModel.chat(message);    }}

ChatRequest chatRequest = ChatRequest.builder()    .messages(UserMessage.from("Julien 喜欢蓝色、白色和红色"))    .responseFormat(ResponseFormat.builder()        .type(JSON)        .jsonSchema(JsonSchema.builder()            .name("Person")            .rootElement(JsonObjectSchema.builder()                .addStringProperty("name")                .addProperty("favouriteColors", JsonArraySchema.builder()                    .items(new JsonStringSchema())                    .build())                .required("name", "favouriteColors")                .build())            .build())        .build())    .build();String answer = chatLanguageModel.chat(chatRequest).aiMessage().text();

在此示例中，`answer` 将是：

{  "name": "Julien",  "favouriteColors": ["蓝色", "白色", "红色"]}

然后，通常会使用 Jackson 等库将此 JSON 响应反序列化为 Java 对象。

StreamingChatLanguageModel model = AzureOpenAiStreamingChatModel.builder()        .endpoint(System.getenv("AZURE_OPENAI_URL"))        .apiKey(System.getenv("AZURE_OPENAI_KEY"))        .deploymentName("gpt-4o")        ...        .build();

